      margin-left: 5px;
      animation: blink 1s infinite;
    }
    @keyframes blink {
      0%, 50% { opacity: 1; }
      51%, 100% { opacity: 0; }

    .controls {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      padding: 10px;
      background: rgba(0,0,0,0.8);
      text-align: center;
      z-index: 5;
    }

      margin: 0 10px;
      font-family: monospace;
